import React from 'react';
import './App.css';
import ListDataSamples from './components/listDataSamples';


function App() {
  return (
    <div style={{
      display: "flex",
      flexDirection: "column",
      alignItems: "center",
      justifyContent: "flex-start",
      height: "100vh",
      width: "100vw"

    }}>
      <div className='tile' tabIndex={1} >
        <div className='tile-content'>
          <ListDataSamples />
        </div>
      </div>
    </div>
  );
}

export default App;
